import React, { useState } from "react";

const CustomInput = () => {
  const [query, setQuery] = useState("kittens");
  const [before, setBefore] = useState(new Date());
  const [after, setAfter] = useState(new Date());

  const submitHandler = (e) => {
    e.preventDefault();
    console.log(e);
  };

  const handleChange = (e) => {
      console.log(e.target.name);
      console.log(e.target.value);
  }

  return (
    <>
      <h2>Custom Youtube Search</h2>
      <form className="form" onSubmit={submitHandler}>
        <div style={{ margin: "20px" }}>
          <input
            type="text"
            placeholder="search"
            name="query"
            onChange={handleChange}
            required
          ></input>
          <button type="submit">Search</button>
        </div>
        <div className="item">
          <div>
            <lable htmlFor="to">After:</lable>
            <input
              type="date"
              id="to"
              name="afterDate"
              onChange={handleChange}
            ></input>
            <input
              type="date"
              id="to"
              name="afterTime"
              onChange={handleChange}
            ></input>
          </div>
          <div>
            <lable htmlFor="for">Before:</lable>
            <input
              type="date"
              id="for"
              name="beforeDate"
              onChange={handleChange}
            ></input>
            <input
              type="time"
              id="for"
              name="beforeTime"
              onChange={handleChange}
            ></input>
          </div>
        </div>
      </form>
    </>
  );
};

export default CustomInput;
